import React from "react";
import styled from "styled-components";

const Main = styled.div`
  width: 100%;
  height: 70vh;
  margin: 10vh 0;
  display: flex;
  align-itens: center;
  justify-content: center;
`;

const PhotoDiv = styled.div`
  width: 35%;
  height: 70%;
  background: aqua;
`;

const DescriptionDiv = styled.div`
  width: 35%;
  height: 70%;
  background: red;
  display: flex;
  padding: 25px 0;
  align-itens: center;
  justify-content: center;
  ul{
    display: flex;
    flex-direction: column;

    li1{
      font-size: 20px;
    }
    li2{
      text-align: justify;
      text-justify: inter-word;
    }
  }
`;



export default function index() {
    return (
        <Main>
          <PhotoDiv/>
          <DescriptionDiv>
            <ul>
              <li1>Quem Somos</li1>
              <li2>
                  asoasfomasfmasom maosmoasmoamfo wmoamoasmfo amoasmo
                  asoasfomasfmasom maosmoasmoamfo wmoamoasmfo amoa, 
                  sdbisdndsmglsdm, mdglmdlmgsdlmglgmthmtomtn,lnlyn,pyrmrlmrr
                  sninfamdoasfg fomgswai ifjir mgirik fmnkig fnin infineikmd
                  safiasfi, fidhfisdjimdkamimaf, iijfiajmfasmfasfinafnfiasfnias
                  sajfiasmosamfmasfmasfmasfmog omofmoeofmeofjie
              </li2>
            </ul>
          </DescriptionDiv>
        </Main>
    );
}
